class CarrotBoxes 
{ 
        public: 
        double theProbability(vector <string> s) 
        { 
      int n=s.size(); 
       
      for (int i=0;i<n;++i) 
        for (int j=0;j<n;++j) 
          d[i][j]=s[i][j]=='Y'; 
       
      for (int k=0;k<n;++k) 
        for (int i=0;i<n;++i) 
          for (int j=0;j<n;++j) 
            d[i][j]|=d[i][k]&&d[k][j]; 
       
      int ans=n; 
      for (int del=0;del<=n;++del) 
      { 
        VI res; 
        res.clear(); 
        for (int i=0;i<n;++i) 
        if (i!=del) 
        { 
          int cnt=0; 
          for (int j=0;j<n;++j) 
          if (j!=del && i!=j) 
            if (d[j][i] && !d[i][j]) 
              ++cnt; 
          if (cnt==0) res.PB(i); 
        } 
         
        int cnt=0; 
        for (int i=0;i<res.size();++i) 
        { 
          bool ok=true; 
          for (int j=0;j<i;++j) 
          if (d[res[i]][res[j]] && d[res[j]][res[i]]) ok=false; 
          cnt+=ok; 
        } 
        ans=min(ans,cnt); 
      } 
       
      return 1-(double)ans/n; 
        } 
         
 
}; 
 
 
 
 
